import React, { Component } from 'react'
import "./index.css"
export default class Header extends Component {
  render() {
    return (
      <div className="cs-Header-x">
        <h1 className="cs-Header-title">Search Github Users</h1>
        <div className="cs-Header-search">
            <input type="text" placeholder="enter the name you search" className="cs-Header-input"/>
            <button className='cs-Header-button'>Search</button>
        </div>
      </div>
    )
  }
}
